    storage_slot: Field,
    state_var_constructor: fn(Context, Field) -> V,
}
// docs:end:map

impl<K, T> Storage<T> for Map<K, T> {}

impl<K, V> Map<K, V> {
    // docs:start:new
    pub fn new(
        context: Context,
