    }
}

impl Eq for AppendOnlyTreeSnapshot {
    fn eq(self, other : AppendOnlyTreeSnapshot) -> bool {
        (self.root == other.root) & (self.next_available_leaf_index == other.next_available_leaf_index)
    }
}

